window.bookSummaryJSON = "<p>The Federation races to discover the culprits of several terrorist attacks, sending their flagship, the USS <i>Prometheus</i>, to stop war breaking out in the galaxy. </p> <p>A mysterious terrorist organisation has carried out several attacks against the Federation and Klingon Empire. Tensions are running high in a region already crippled by conflict. The perpetrators are tracked to the Lembatta Cluster, a mysterious region of space whose inhabitants, the Renao, regard the Alpha Quadrant s powers as little more than conquering tyrants. The Federation are desperate to prevent more bloodshed, and have sent their most powerful warship, the USS<i> Prometheus</i>, into the Cluster to investigate the threat before all-consuming war breaks out. </p> <p>™ &amp; © 2016 CBS Studios Inc. STAR TREK and related marks and logos are trademarks of CBS Studios Inc. All Rights Reserved. </p> <p>Executive Producers Nicholas Briggs and Jason Haigh-Ellery.</p>"; 
